-- ----------------------------
-- Table structure for t_pmodel
-- ----------------------------
DROP TABLE IF EXISTS `t_pmodel`;
CREATE TABLE `t_pmodel` (
  `id` int(11) NOT NULL COMMENT '模型表',
  `name` varchar(255) DEFAULT NULL,
  `url` varchar(255) DEFAULT NULL COMMENT '模型表',
  `x` double DEFAULT NULL,
  `y` double DEFAULT NULL,
  `z` double DEFAULT NULL,
  `hoading` double DEFAULT NULL,
  `pitch` double DEFAULT NULL,
  `roll` double DEFAULT NULL,
  `scalex` double DEFAULT NULL,
  `scaley` double DEFAULT NULL,
  `scalez` double DEFAULT NULL,
  `unitname` varchar(255) NOT NULL COMMENT '对应部件表name',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unitname` (`unitname`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='模型表';

