DROP TABLE IF EXISTS `t_project`;
CREATE TABLE `t_project` (
  `id` tinyint(4) NOT NULL AUTO_INCREMENT COMMENT '项目ID',
  `name` varchar(255) DEFAULT NULL COMMENT '项目名',
  `imgurl` varchar(255) DEFAULT NULL COMMENT '图片URL',
  `price` double(10,2) DEFAULT NULL COMMENT '造价',
  `start_time` date DEFAULT NULL,
  `period` varchar(255) DEFAULT NULL COMMENT '施工周期',
  `duty_person` varchar(255) DEFAULT NULL COMMENT '负责人',
  `company` varchar(255) DEFAULT NULL COMMENT '施工单位',
  `acreage` double(255,0) DEFAULT NULL COMMENT '占地面积',
  `state` tinyint(1) DEFAULT NULL COMMENT '状态:0代表未施工,1代表施工中,2,代表施工完成',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='项目表';

